import React from 'react';
import './input-hashtags.module.scss'

function TextareaHashtags() {
  return (
    <div className="input-hashtags">
      <div className="input-hashtags__wrapper">
        <label className="input-hashtags__label" htmlFor="hashtags">ТЭГИ</label>
        <input 
          className="input-hashtags__input"
          type="text"
          name="hashtags"
          id="hashtags"
          placeholder="test"
          value="#введенные #тэги"
        ></input>
      </div>
    </div>
  );
}

export default TextareaHashtags;
